// Get the invoice data from the collection
const invoiceData = collections['d5d5f194-2f77-43d6-80bc-7c82ad8fffc0']?.['data']?.['data'];

// If no data exists, return empty array
if (!invoiceData || !Array.isArray(invoiceData)) {
    return [];
}

// Get current date
const currentDate = new Date();

// Map through each invoice and add ExpirationDays field
return invoiceData.map(invoice => {
    // Create a copy of the invoice object
    const invoiceWithExpiration = { ...invoice };

    // Calculate ExpirationDays if dueDate exists
    if (invoice.dueDate) {
        const dueDateObj = new Date(invoice.dueDate);
        // Calculate difference in days (current date - due date)
        const timeDifference = currentDate.getTime() - dueDateObj.getTime();
        const daysDifference = Math.floor(timeDifference / (1000 * 60 * 60 * 24));

        // Format the ExpirationDays message
        if (daysDifference > 0) {
            invoiceWithExpiration.ExpirationDays = `${daysDifference}`;
        } else if (daysDifference === 0) {
            invoiceWithExpiration.ExpirationDays = "0";
        } else {
            const daysUntilDue = Math.abs(daysDifference);
            invoiceWithExpiration.ExpirationDays = `- ${daysUntilDue}`;
        }
    } else {
        invoiceWithExpiration.ExpirationDays = "0";
    }

    // Truncate personName to 23 characters and add "..." if longer
    if (invoice.personName && invoice.personName.length > 23) {
        invoiceWithExpiration.personName = invoice.personName.substring(0, 23) + "...";
    }

    // Format the date field if it exists (keeping existing formatting)
    if (invoice.date) {
        const dateObj = new Date(invoice.date);
        const day = String(dateObj.getDate()).padStart(2, '0');
        const month = String(dateObj.getMonth() + 1).padStart(2, '0');
        const year = dateObj.getFullYear();
        invoiceWithExpiration.date = `${day}-${month}-${year}`;
    }

    // Format the dueDate field if it exists (keeping existing formatting)
    if (invoice.dueDate) {
        const dueDateObj = new Date(invoice.dueDate);
        const day = String(dueDateObj.getDate()).padStart(2, '0');
        const month = String(dueDateObj.getMonth() + 1).padStart(2, '0');
        const year = dueDateObj.getFullYear();
        invoiceWithExpiration.dueDate = `${day}-${month}-${year}`;
    }

    return invoiceWithExpiration;
});
